Go + MongoDB: polymorphic queries<p>(sorry this question turned out longer than I had thought...)</p>

<p>I'm using Go and MongoDB with the mgo driver. I'm trying to persist and retrieve different structs (implementing a common interface) in the same MongoDB collection. I'm coming from the Java world (where this is very easily done with Spring with literally no config) and I'm having a hard time doing something similar with Go.
I have read every last related article or post or StackExchange question I could find, but still I haven't found a complete solution. This includes:</p>

<ul>
<li><a href="https://stackoverflow.com/questions/18340031/unstructured-mongodb-collections-with-mgo">Unstructured MongoDB collections with mgo</a></li>
<li><a href="https://stackoverflow.com/questions/7850140/how-do-you-create-a-new-instance-of-a-struct-from-its-type-at-run-time-in-go">How do you create a new instance of a struct from its type at run time in Go?</a></li>
<li><a href="https://stackoverflow.com/questions/40879748/golang-reflect-get-type-representation-from-name">Golang reflect: Get Type representation from name?</a></li>
</ul>

<p>Here's a simplified setup I use for testing. Suppose two structs <code>S1</code> and <code>S2</code>, implementing a common interface <code>I</code>. <code>S2</code> has an implicit field of type <code>S1</code>, meaning that structure-wise <code>S2</code> embeds a <code>S1</code> value, and that type-wise <code>S2</code> implements <code>I</code>. </p>

<pre><code>type I interface {
    f1()
}

type S1 struct {
    X int
}

type S2 struct {
    S1
    Y int
}

func (*S1) f1() {
    fmt.Println("f1")
}
</code></pre>

<p>Now I can save an instance of <code>S1</code> or <code>S2</code> easily using <code>mgo.Collection.Insert()</code>, but to properly populate a value using <code>mgo.Collection.Find().One()</code> for example, I need to pass a pointer to an existing value of <code>S1</code> or <code>S2</code>, which means I already know the type of the object I want to read!!
I want to be able to retrieve a document from the MongoDB collection without knowing if it's a <code>S1</code>, or a <code>S2</code>, or in fact any object that implements <code>I</code>.</p>

<p>Here's where I am so far: instead of directly saving the object I want to persist, I save a <code>Wrapper</code> struct that holds the MongoDB id, an identifier of the type, and the actual value. The type identifier is a concatenation of <em>packageName</em> + "." + <em>typeName</em>, and it is used to lookup the type in a type registry, since there is no native mechanism to map from a type name to a Type object in Go. This means I need to register the types that I want to be able to persist and retrieve, but I could live with that. Here's how it goes:</p>

<pre><code>typeregistry.Register(reflect.TypeOf((*S1)(nil)).Elem())
typeregistry.Register(reflect.TypeOf((*S2)(nil)).Elem())
</code></pre>

<p>Here's the code for the type registry:</p>

<pre><code>var types map[string]reflect.Type

func init() {
    types = make(map[string]reflect.Type)
}

func Register(t reflect.Type) {
    key := GetKey(t)
    types[key] = t
}

func GetKey(t reflect.Type) string {
    key := t.PkgPath() + "." + t.Name()
    return key
}

func GetType(key string) reflect.Type {
    t := types[key]
    return t
}
</code></pre>

<p>The code for saving an object is quite straightforward:</p>

<pre><code>func save(coll *mgo.Collection, s I) (bson.ObjectId, error) {
    t := reflect.TypeOf(s)
    wrapper := Wrapper{
        Id:      bson.NewObjectId(),
        TypeKey: typeregistry.GetKey(t),
        Val:     s,
    }
    return wrapper.Id, coll.Insert(wrapper)
}
</code></pre>

<p>The code for retrieving an object is a bit more tricky:</p>

<pre><code>func getById(coll *mgo.Collection, id interface{}) (*I, error) {
    // read wrapper
    wrapper := Wrapper{}
    err := coll.Find(bson.M{"_id": id}).One(&amp;wrapper)
    if err != nil {
        return nil, err
    }

    // obtain Type from registry
    t := typeregistry.GetType(wrapper.TypeKey)

    // get a pointer to a new value of this type
    pt := reflect.New(t)

    // FIXME populate value using wrapper.Val (type bson.M)
    // HOW ???

    // return the value as *I
    i := pt.Elem().Interface().(I)
    return &amp;i, nil
}
</code></pre>

<p>This partially works as the returned object is typed correctly, but what i can't figure out is how to populate the value <code>pt</code> with the data retrieved from MongoDB which is stored in <code>wrapper.Val</code> as a <code>bson.M</code>.</p>

<p>I have tried the following but it doesn't work:</p>

<pre><code>m := wrapper.Val.(bson.M)
bsonBytes, _ := bson.Marshal(m)
bson.Unmarshal(bsonBytes, pt)
</code></pre>

<p>So basically the remaining problem is: how to populate an unknown structure from a <code>bson.M</code> value? I'm sure there has to be an easy solution...
Thanks in advance for any help.</p>

<p>Here's a Github gist with all the code: <a href="https://gist.github.com/ogerardin/5aa272f69563475ba9d7b3194b12ae57" rel="nofollow noreferrer">https://gist.github.com/ogerardin/5aa272f69563475ba9d7b3194b12ae57</a></p>

