Mongoose Aggregate - Lookup conditionally (either user1 or user2)<p>I'm writing a DB Aggregate function to get <code>ChatHeads</code> for a user from <code>Messages</code> table.</p>

<p>Following is a message object from <code>Messages</code> Table</p>

<pre><code>{
  "_id": "5c6e54c194509100146ea6da",
  "chat_id": "5bc81391767ba50013bc251c5bc58ac0ff45070013383422",
  "user1": "5bc58ac0ff45070013383422",
  "user2": "5bc81391767ba50013bc251c",
  "messageFrom": "5bc58ac0ff45070013383422",
  "dateTime": "2019-02-21T07:35:29.653Z",
  "message": "Hello ",
}
</code></pre>

<p>Depending upon the user that is making the request, the chat head should populate the other user's id to display his name/picture in the chat head.</p>

<p>I'm using Aggregate to get the chat heads but conditional population of the other user is what I'm getting trouble in. Following is my current query where <code>req.user._id</code> is the ID of the requesting user.</p>

<pre><code>chat.aggregate(

{
  $match: {
      $or: [ { user1:req.user._id }, { user2:req.user._id } ]
  }
},
{
  $group:{
      _id: '$chat_id',
      entry: { $first: "$$ROOT" },

  }
}
</code></pre>

<p>As per my understanding <code>$lookup</code> with conditioning might help where <code>localField</code> should change to <code>entry.user1</code> or <code>entry.user2</code> depending upon their value.</p>

<p>Following is the aggregate part</p>

<pre><code>$lookup: {
               from: "users",
               localField: &lt; "entry.user1" or "entry.user2" depending upon condition&gt; ,
               foreignField: "_id",
               as: "other_user"
            }
</code></pre>

<p>My Requirement</p>

<p><code>localField</code> should say <code>entry.user1</code> if <code>entry.user1==req.user._id</code></p>

<p><code>localField</code> should say <code>entry.user2</code> if <code>entry.user2==req.user._id</code></p>

