<p>The User document contains the data related to the app users - ie. user accounts.</p>

<p>The Clinic document contains information related to a clinic, which includes a list of providers, where the providers are references to the <code>User</code> model.</p>

<p>The schema for these models are below.</p>

<p><strong>User.model.js</strong></p>

<pre><code>const mongoose = require('mongoose');
const Schema = mongoose.Schema;
const UserSchema = new Schema({
  name: {
    type: String,
    required: true
  },
  email: {
    type: String,
    required: true
  },
  password: {
    type: String,
    required: true
  }
});
module.exports = User= mongoose.model('users', UserSchema);
</code></pre>

<p><strong>Clinic.model.js</strong></p>

<pre><code>const mongoose = require('mongoose');
const Schema = mongoose.Schema;
const ClinicSchema = new Schema({
  providers: [
    {
      user: {
        type: Schema.Types.ObjectId,
        ref: 'users'
      }
    }
  ],
  name: {
    type: String,
    required: true
  }
});
module.exports = Clinic = mongoose.model('clinics', ClinicSchema);
</code></pre>

<p>On the front end I have the users 'profile' where they view their information. To populate this view, I have a GET route on the backend that serves the user's data (note: they must be logged in to access).</p>

<p>Before the data is sent from the backend, I want to find what Clinics the user is a provider for (ie. clinic objects where they are in the <code>provider</code> array) and add this to the JSON response. Adding the data to the JSON res is easy, but I am struggling to workout how to look through the <code>Clinic</code> entries and return the clinic objects where <code>req.user.id is === provider.user.toString()</code></p>

